import { BrowserRouter, Routes ,Route} from 'react-router-dom';
import './App.css';
import Home from './components/home';
import Nav from './components/Nav';


function App() {
  return (
    <div className="App">
      <Nav/>
    <BrowserRouter>
    <Routes >
      <Route path="/" element={<Home />}></Route>
    </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
